import React from 'react';
import './Card.css'; // Importing card-specific CSS

const Card = () => {
  const cards = [
    {
      id: 1,
      imgSrc: 'https://picsum.photos/id/1011/800/450',
      title: 'This is some title',
      description: 'Curabitur convallis ac quam vitae laoreet. Nulla mauris ante, euismod sed lacus sit amet, congue bibendum eros.',
    },
    {
      id: 2,
      imgSrc: 'https://picsum.photos/id/1005/800/450',
      title: 'This is some title',
      description: 'Curabitur convallis ac quam vitae laoreet. Nulla mauris ante, euismod sed lacus sit amet, congue bibendum eros.',
    },
    {
      id: 3,
      imgSrc: 'https://picsum.photos/id/103/800/450',
      title: 'This is some title',
      description: 'Curabitur convallis ac quam vitae laoreet. Nulla mauris ante, euismod sed lacus sit amet, congue bibendum eros.',
    },
  ];

  return (
    <section className="cards-section">
      <div className="articles">
        {cards.map(card => (
          <article key={card.id}>
            <div className="article-wrapper">
              <figure>
                <img src={card.imgSrc} alt={card.title} />
              </figure>
              <div className="article-body">
                <h2>{card.title}</h2>
                <p>{card.description}</p>
                <a href="#" className="read-more">
                  Read more <span className="sr-only">about {card.title}</span>
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    className="icon"
                    viewBox="0 0 20 20"
                    fill="currentColor"
                  >
                    <path
                      fillRule="evenodd"
                      d="M12.293 5.293a1 1 0 011.414 0l4 4a1 1 0 010 1.414l-4 4a1 1 0 01-1.414-1.414L14.586 11H3a1 1 0 110-2h11.586l-2.293-2.293a1 1 0 010-1.414z"
                      clipRule="evenodd"
                    />
                  </svg>
                </a>
              </div>
            </div>
          </article>
        ))}
      </div>
    </section>
  );
};

export default Card;
